import React from 'react'
import './estilosComponentes/ingrediente.css'
const ElementoIngrediente = (de) => {
  return (
    <li key={de.index}>
        {de.datos[0]} contiene {de.datos[1]} calorias
    </li>
  )
}

export default ElementoIngrediente
